import React from "react";
import {Link} from "react-router-dom"

function Header() {
    return (
        <div className="header">   
        <ul>
        <Link to="/about">
            <li>About</li>
            </Link>
            <li>Sign up</li>
            <li>Sign in</li>
        </ul>
        </div>
    );
}

export default Header;



